INSERT INTO `activity_tbl` (`act_recno`, `act_actcode`, `act_title`, `act_desc`, `act_classcode`, `act_withfile`, `act_filedir`, `act_actdate`, `act_deadline`, `isdel`) VALUES
(1, '10', 'Emoji Story-telling', 'This can also be done for activities other than sandwich-making.  In fact, anything that comes with instructions such as furniture or technological gadgets detail sequences of steps to achieve a desired outcome.  In actual coding, inputting specific symbols in a sequence influence the end result as well. ', '4321', 1, 'uploads/pikachu.png', '2020-04-29 13:17:00', '2020-04-08 00:00:00', 0),
(2, '10', 'Instructor Sentence Examples\r\n', ' Again, not all dogmatic teachings of the pope are under the guarantee of infallibility; neither his opinions as private instructor, nor his official allocutions, however authoritative they may be, are infallible; it is only his ex cathedra instruction which is guaranteed; this is admitted by everybody.', '4322', 1, 'uploads/pikachu.png', '2020-04-29 13:18:09', '2020-04-22 00:00:00', 0),
(3, '10', 'testing my title', 'this is my life', '4323', 1, 'uploads/pikachu.png', '2020-04-29 13:18:24', '2020-04-22 00:00:00', 0),
(4, '', 'Activities for Programming ', 'Learning to code without a computer may seem illogical, but it makes perfect sense.  Unplugging the computer and teaching coding through more familiar mediums such as hands-on activities, can make the subject less intimidating and more interactive.', '4321', 1, 'uploads/pikachu.png', '2020-04-29 13:18:09', '2020-04-22 00:00:00', 0);
