(53, '49', '4322', 'H1359', 'Hello', '2020-05-13 05:51:55', 0),
(54, '50', '4322', 'H1359', 'On returning to Prussia he became mathematical instructor at the school of military engineering, leaving this post in 1792 to take part as a general staff officer in the war against France.', '2020-05-13 08:51:15', 0),
(55, '51', '4322', 'H1359', 'Java is among the most popular programming languages out there, mainly because of how versatile and compatible it is. Java can be used for a large number of things, including software development, mobile applications, and large systems development. As of 2019, 88% market share of all smartphones run on Android, the mobile operating system written in Java. Knowing Java opens a great deal of doors for you as a developer.', '2020-05-14 02:51:24', 0);
